    false,nt"url": null,nt"notes": "This part of DS 781 presents data for 2-m
    and 5-m bathymetry and shaded-relief maps of Monterey Canyon and Vicinity, California.
    The raster data file is included in "BathymetryB_5m_MontereyCanyon.zip," which
    is accessible from http://dx.doi.org/10.5066/F7XD0ZQ4. The 2-m and 5-m bathymetry
    and shaded-relief maps of Monterey Canyon and Vicinity, California, were generated
    from bathymetry data collected by the U.S. Geological Survey (USGS), by Monterey
    Bay Aquarium Research Institute (MBARI), and by California State University, Monterey
    Bay (CSUMB). Mapping was completed between 1998 and 2014 using a combination of
    30-kHz Simrad EM-300 and 200-kHz/400-kHz Reson 7125 multibeam echosounders, as well
    as 234-kHz and 468-kHz SEA SWATHplus bathymetric sidescan-sonar systems. The mapping
    missions collected bathymetry data from about the 10-m isobath to beyond the 3-nautical-mile
    limit of Californiau0102u00ads State Waters. NOTE: The horizontal datum of this
    bathymetry data (NAD83) differs from the horizontal datum of other layers in this
    data release (WGS84).",nt"license_title": null,nt"extras": [{ntt"key":
